import React from "react";
import AppBar from "@material-ui/core/AppBar";
import { makeStyles } from "@material-ui/core/styles";
import Toolbar from "@material-ui/core/Toolbar";
import HomeIcon from "../generalhome/HomeIcon";
import Link from "@material-ui/core/Link";
import "../../../../index.css";
import Grid from "@material-ui/core/Grid";
//import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import Badge from "@material-ui/core/Badge";
import NotificationsIcon from "@material-ui/icons/Notifications";
import AccountCircle from "@material-ui/icons/AccountCircle";

const useStyles = makeStyles((theme) => ({
  grow: {
    flexGrow: 1,
    backgroundColor: "#d2dae3",
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

export default function UserNavBar1() {
  const classes = useStyles();
  return (
    <div className={classes.grow}>
      <AppBar position="static" style={{ backgroundColor: "#00b643" }}>
        <Toolbar>
          <Grid container spacing={1}>
            <Grid item xs={2}>
              <Typography
                variant="h6"
                className={classes.title}
                style={{ textAlign: "left" }}
              >
                <Link
                  href="/"
                  style={{
                    color: "inherit",
                    fontFamily: "Lobster",
                    fontSize: "1.2rem",
                  }}
                >
                  My Portfolio
                </Link>
                <HomeIcon></HomeIcon>
              </Typography>
            </Grid>

            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Create Protfolio
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Financial Goals
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Reports
              </Link>
            </Grid>
            <Grid item xs={1}>
              <Link
                href="/signinsuccess"
                style={{
                  color: "inherit",
                  fontSize: "1.2rem",
                }}
              >
                Drafted Solutions
              </Link>
            </Grid>
            <Grid item xs={2}></Grid>

            <Grid item xs={2}>
              <Typography className={classes.title}>Ravindra P</Typography>
            </Grid>

            <Grid item xs={2}>
              <Typography className={classes.title}>Ravindra P</Typography>
              <IconButton
                edge="end"
                aria-label="account of current user"
                aria-haspopup="true"
                color="inherit"
              >
                <AccountCircle />
              </IconButton>
              <IconButton
                aria-label="show 17 new notifications"
                color="inherit"
              >
                <Badge badgeContent={17} color="secondary">
                  <NotificationsIcon />
                </Badge>
              </IconButton>
              <IconButton
                edge="start"
                className={classes.menuButton}
                color="inherit"
                aria-label="open drawer"
              >
                <MenuIcon />
              </IconButton>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
}
